// Auto-init when DOM ready
document.addEventListener('DOMContentLoaded', () => {
    try {
        I18n.init();
    } catch (e) {
        // silent
    }
});

// Re-translate on full page load (after all scripts)
window.addEventListener('load', () => {
    setTimeout(() => {
        try {
            if (typeof I18n !== 'undefined' && I18n.translatePage) {
                I18n.translatePage();
            }
        } catch (e) {
            // silent
        }
    }, 300);
});

// MutationObserver for dynamic content
(function() {
    let observer = null;
    function setup() {
        if (observer) return;
        observer = new MutationObserver((mutations) => {
            let needs = false;
            mutations.forEach((m) => {
                m.addedNodes.forEach((n) => {
                    if (n.nodeType === Node.ELEMENT_NODE) {
                        if (n.hasAttribute && n.hasAttribute('data-i18n')) needs = true;
                        if (n.querySelectorAll && n.querySelectorAll('[data-i18n]').length > 0) needs = true;
                    }
                });
            });
            if (needs && typeof I18n !== 'undefined' && I18n.translatePage) {
                clearTimeout(window._i18nDebounce);
                window._i18nDebounce = setTimeout(() => I18n.translatePage(), 100);
            }
        });
        if (document.body) {
            observer.observe(document.body, { childList: true, subtree: true });
        }
    }
    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', setup);
    } else {
        setup();
    }
})();

// Export
window.I18n = I18n;
